import React from 'react';
import classes from './ModalPost.module.css'

const ModalPost = ({children}) => {
  return (
    <div className={[classes.modalPost, classes.modalPost__active].join(' ')}>
      <div className={classes.modalPost__content}>
        {children}
      </div>
    </div>
  );
};

export default ModalPost;
